import React from 'react';
import {Router,Switch, Route} from 'react-router-dom';
//hooking together all pages
import LandingPage from './landingpage';


const Main = () => (
  <Router>
  <Switch>
    <Route path="/" component={LandingPage} />
  </Switch>
  </Router>

)

  export default Main;
